INSERT INTO `frontends` (`id`, `data_keys`, `data_values`, `created_at`, `updated_at`) VALUES
(1, 'seo.data', '{\"seo_image\":\"1\",\"keywords\":[\"admin\",\"blog\",\"manage\",\"mlm\",\"mlmlab\",\"binary mlm\",\"php mlm\",\"safeworld1\",\"world\",\"safe\",\"Trade\",\"investment\",\"best\"],\"description\":\"Safe World 1 is Crypto investment platform,.\\nSafe Invest to earn best profit.\",\"social_title\":\"Safe World\",\"social_description\":\"Safe World 1\",\"image\":\"60e1b3f74293d1625404407.jpg\"}', '2020-07-04 23:42:52', '2021-08-12 14:39:11'),
(24, 'about.content', '{\"has_image\":\"1\",\"heading\":\"About Us\",\"video_link\":\"https:\\/\\/youtu.be\\/m5kTcWDxvCc\",\"description\":\"<div style=\\\"text-align:justify;\\\"><div><p style=\\\"margin-right:0px;margin-bottom:10px;margin-left:0px;padding:0px;border:0px;line-height:1.5;font-family:Helvetica, sans-serif;font-size:13px;vertical-align:baseline;color:#000000;\\\">Safe World 1, an \\\"investment company\\\" is a company (corporation, business trust, partnership, or limited liability company) that issues securities and is primarily engaged in the business of investing in securities.<\\/p><p style=\\\"margin-right:0px;margin-bottom:10px;margin-left:0px;padding:0px;border:0px;line-height:1.5;font-family:Helvetica, sans-serif;font-size:13px;vertical-align:baseline;color:#000000;\\\">An investment company invests the money it receives from investors on a collective basis, and each investor shares in the profits and losses in proportion to the investor\'s interest in the investment company. The performance of the investment company will be based on (but it won\'t be identical to) the performance of the securities and other assets that the investment company owns.<\\/p><p style=\\\"margin-right:0px;margin-bottom:10px;margin-left:0px;padding:0px;border:0px;line-height:1.5;font-family:Helvetica, sans-serif;font-size:13px;vertical-align:baseline;color:#000000;\\\">The federal securities laws categorize investment companies into three basic types:<\\/p><ul style=\\\"margin-bottom:10px;margin-left:20px;padding-left:20px;border:0px;line-height:inherit;font-family:Helvetica, sans-serif;font-size:13px;vertical-align:baseline;list-style-type:disc;clear:both;color:rgb(16,31,54);\\\"><li style=\\\"margin:0px 0px 5px;padding:0px;border:0px;font-style:inherit;font-variant:inherit;font-weight:inherit;line-height:1.5;font-family:inherit;font-size:13px;vertical-align:baseline;color:#000000;\\\"><a href=\\\"https:\\/\\/www.sec.gov\\/answers\\/mutfund.htm\\\" style=\\\"margin:0px;padding:0px;border:0px;font-style:inherit;font-variant:inherit;font-weight:inherit;line-height:inherit;font-family:inherit;font-size:13px;vertical-align:baseline;color:rgb(47,100,178);\\\">Mutual funds<\\/a>\\u00a0(legally known as open-end companies);<\\/li><li style=\\\"margin:0px 0px 5px;padding:0px;border:0px;font-style:inherit;font-variant:inherit;font-weight:inherit;line-height:1.5;font-family:inherit;font-size:13px;vertical-align:baseline;color:#000000;\\\"><a href=\\\"https:\\/\\/www.sec.gov\\/answers\\/mfclose.htm\\\" style=\\\"margin:0px;padding:0px;border:0px;font-style:inherit;font-variant:inherit;font-weight:inherit;line-height:inherit;font-family:inherit;font-size:13px;vertical-align:baseline;color:rgb(47,100,178);\\\">Closed-end funds<\\/a>\\u00a0(legally known as closed-end companies);<\\/li><li style=\\\"margin:0px 0px 5px;padding:0px;border:0px;font-style:inherit;font-variant:inherit;font-weight:inherit;line-height:1.5;font-family:inherit;font-size:13px;vertical-align:baseline;color:#000000;\\\"><a href=\\\"https:\\/\\/www.sec.gov\\/answers\\/uit.htm\\\" style=\\\"margin:0px;padding:0px;border:0px;font-style:inherit;font-variant:inherit;font-weight:inherit;line-height:inherit;font-family:inherit;font-size:13px;vertical-align:baseline;color:rgb(47,100,178);\\\">UITs<\\/a>\\u00a0(legally known as unit investment trusts).<\\/li><\\/ul><p style=\\\"margin-right:0px;margin-bottom:10px;margin-left:0px;padding:0px;border:0px;line-height:1.5;font-family:Helvetica, sans-serif;font-size:13px;vertical-align:baseline;color:#000000;\\\">Each type has its own unique features. For example, mutual fund and UIT shares are \\\"redeemable\\\" (meaning that when investors want to sell their shares, they sell them back to the fund or trust, or to a broker acting for the fund or trust, at their approximate\\u00a0<a href=\\\"https:\\/\\/www.sec.gov\\/answers\\/nav.htm\\\" style=\\\"margin:0px;padding:0px;border:0px;font-style:inherit;font-variant:inherit;font-weight:inherit;line-height:inherit;font-family:inherit;font-size:13px;vertical-align:baseline;color:rgb(47,100,178);\\\">net asset value<\\/a>). Closed-end fund shares, on the other hand, generally are not redeemable. Instead, when closed-end fund investors want to sell their shares, they generally sell them to other investors on the secondary market, at a price determined by the market. In addition, there are variations within each type of investment company, such as\\u00a0<a href=\\\"https:\\/\\/www.sec.gov\\/answers\\/mfstock.htm\\\" style=\\\"margin:0px;padding:0px;border:0px;font-style:inherit;font-variant:inherit;font-weight:inherit;line-height:inherit;font-family:inherit;font-size:13px;vertical-align:baseline;color:rgb(47,100,178);\\\">stock funds<\\/a>,\\u00a0<a href=\\\"https:\\/\\/www.sec.gov\\/answers\\/bondfunds.htm\\\" style=\\\"margin:0px;padding:0px;border:0px;font-style:inherit;font-variant:inherit;font-weight:inherit;line-height:inherit;font-family:inherit;font-size:13px;vertical-align:baseline;color:rgb(47,100,178);\\\">bond funds<\\/a>,\\u00a0<a href=\\\"https:\\/\\/www.sec.gov\\/answers\\/mfmmkt.htm\\\" style=\\\"margin:0px;padding:0px;border:0px;font-style:inherit;font-variant:inherit;font-weight:inherit;line-height:inherit;font-family:inherit;font-size:13px;vertical-align:baseline;color:rgb(47,100,178);\\\">money market funds<\\/a>,\\u00a0<a href=\\\"https:\\/\\/www.sec.gov\\/answers\\/indexf.htm\\\" style=\\\"margin:0px;padding:0px;border:0px;font-style:inherit;font-variant:inherit;font-weight:inherit;line-height:inherit;font-family:inherit;font-size:13px;vertical-align:baseline;color:rgb(47,100,178);\\\">index funds<\\/a>,\\u00a0<a href=\\\"https:\\/\\/www.sec.gov\\/answers\\/mfinter.htm\\\" style=\\\"margin:0px;padding:0px;border:0px;font-style:inherit;font-variant:inherit;font-weight:inherit;line-height:inherit;font-family:inherit;font-size:13px;vertical-align:baseline;color:rgb(47,100,178);\\\">interval funds<\\/a>, and\\u00a0<a href=\\\"https:\\/\\/www.sec.gov\\/answers\\/etf.htm\\\" style=\\\"margin:0px;padding:0px;border:0px;font-style:inherit;font-variant:inherit;font-weight:inherit;line-height:inherit;font-family:inherit;font-size:13px;vertical-align:baseline;color:rgb(47,100,178);\\\">exchange-traded funds (ETFs)<\\/a>.<\\/p><p style=\\\"margin-right:0px;margin-bottom:10px;margin-left:0px;padding:0px;border:0px;line-height:1.5;font-family:Helvetica, sans-serif;font-size:13px;vertical-align:baseline;color:#000000;\\\">Some types of companies that might initially appear to be investment companies may actually be excluded under the federal securities laws. For example, private investment funds with no more than 100 investors and private investment funds whose investors each have a substantial amount of investment assets are not considered to be investment companies\\u2014even though they issue securities and are primarily engaged in the business of investing in securities. This may be because of the private nature of their offerings or the financial means and sophistication of their investors. For additional information on these types of private investment funds, please refer to\\u00a0<a href=\\\"https:\\/\\/www.sec.gov\\/answers\\/hedge.htm\\\" style=\\\"margin:0px;padding:0px;border:0px;font-style:inherit;font-variant:inherit;font-weight:inherit;line-height:inherit;font-family:inherit;font-size:13px;vertical-align:baseline;color:rgb(47,100,178);\\\">Hedge Funds<\\/a>\\u00a0in our Fast Answers databank.<\\/p><p style=\\\"margin-right:0px;margin-bottom:10px;margin-left:0px;padding:0px;border:0px;line-height:1.5;font-family:Helvetica, sans-serif;font-size:13px;vertical-align:baseline;color:#000000;\\\">Before purchasing shares of an investment company, you should carefully\\u00a0<a href=\\\"https:\\/\\/www.sec.gov\\/answers\\/mfinfo.htm\\\" style=\\\"margin:0px;padding:0px;border:0px;font-style:inherit;font-variant:inherit;font-weight:inherit;line-height:inherit;font-family:inherit;font-size:13px;vertical-align:baseline;color:rgb(47,100,178);\\\">read all of a fund\'s available information<\\/a>, including its prospectus and most recent shareholder report.<\\/p><p style=\\\"margin-right:0px;margin-bottom:10px;margin-left:0px;padding:0px;border:0px;line-height:1.5;font-family:Helvetica, sans-serif;font-size:13px;vertical-align:baseline;color:#000000;\\\">Investment companies are regulated primarily under the Investment Company Act of 1940 and the rules and registration forms adopted under that Act. Investment companies are also subject to the Securities Act of 1933 and the Securities Exchange Act of 1934. For the definition of \\\"investment company,\\\" you should refer to\\u00a0<a href=\\\"https:\\/\\/www.sec.gov\\/about\\/laws\\/ica40.pdf\\\" style=\\\"margin:0px;padding:0px;border:0px;font-style:inherit;font-variant:inherit;font-weight:inherit;line-height:inherit;font-family:inherit;font-size:13px;vertical-align:baseline;color:rgb(47,100,178);\\\">Section 3 of the Investment Company Act of 1940<\\/a>\\u00a0and the rules under that section.<\\/p><\\/div><div><br \\/><\\/div><\\/div><blockquote style=\\\"margin:0 0 0 40px;border:none;padding:0px;\\\"><\\/blockquote><blockquote style=\\\"margin:0 0 0 40px;border:none;padding:0px;\\\"><\\/blockquote><blockquote style=\\\"margin:0 0 0 40px;border:none;padding:0px;\\\"><\\/blockquote><blockquote style=\\\"margin:0 0 0 40px;border:none;padding:0px;\\\"><\\/blockquote>\",\"background_image\":\"61195f7c9b0a81629052796.png\"}', '2020-10-28 00:51:20', '2021-08-15 21:48:49'),
