(1, '1', 0, 'Hey,\r\n\r\nIt is a Good time! To discuss now for White-label SEO & SMO Work.\r\n\r\nWe run Digital Marketing Agency that helps branding in digital culture. We can help you with our reliable SEO & SMO support. As we are expanding our operations, we have decided to approach more agencies for the intelligible associations. In the last 6 years, we have started working with 60+ Digital agencies just like yours and they love our work. This is why I have decided to approach more because I believe that my team can help you scale your business just like we are helping other agencies like yours.\r\n\r\nDo you want to improve the rankings of your website? Do you want Guaranteed Business Leads, Sales, Conversions & Enquires?\r\n\r\nIf the answer is YES, Please share your \"Phone Number\" and a suitable time to talk, so I can explain it to you better.\r\n\r\nRespectfully,\r\nDave Brown\r\nDigital Marketing Expert\r\nCall : (614) 927-1021', '2021-07-05 15:44:16', '2021-07-05 15:44:16'),
